import React from 'react';
import Header from "./components/Header";
import './App.css';
import logo1 from './img/AI-logo.png'
import {BrowserRouter as Router,NavLink} from 'react-router-dom'
import {Route} from 'react-router-dom'
import Notification from "./components/Sidebar/Notification";
import TradeI from "./components/Sidebar/Trade_I";
import TariffM from "./components/Sidebar/Tariff_M";
import NonTariffM from "./components/Sidebar/NonTariff_M";
import Commodity from "./components/Sidebar/Commodity";
import CaseS from "./components/Sidebar/Case_S";
import Blog from "./components/Sidebar/Blog";
import Report from "./components/Sidebar/Report";

function App() {
  return (
      <Router>
          <div className="sidebar">
              <img src={logo1}/>
              <div className="sidebar-content">
                  <ul>
                          <li><NavLink to="/" exact activeStyle={{color:"#109CF1"}}>
                              <svg width="2em" height="1em" viewBox="0 0 21 21" fill="none" xmlns="http://www.w3.org/2000/svg">
                                  <path d="M3.5 10.1333C3.33431 10.1333 3.2 9.99902 3.2 9.83333V3.5C3.2 3.33431 3.33431 3.2 3.5 3.2H8.16667C8.33235 3.2 8.46667 3.33431 8.46667 3.5V9.83333C8.46667 9.99902 8.33235 10.1333 8.16667 10.1333H3.5ZM3.5 16.8C3.33431 16.8 3.2 16.6657 3.2 16.5V13.5C3.2 13.3343 3.33431 13.2 3.5 13.2H8.16667C8.33235 13.2 8.46667 13.3343 8.46667 13.5V16.5C8.46667 16.6657 8.33235 16.8 8.16667 16.8H3.5ZM11.8333 16.8C11.6676 16.8 11.5333 16.6657 11.5333 16.5V10.1667C11.5333 10.001 11.6676 9.86667 11.8333 9.86667H16.5C16.6657 9.86667 16.8 10.001 16.8 10.1667V16.5C16.8 16.6657 16.6657 16.8 16.5 16.8H11.8333ZM11.5333 3.5C11.5333 3.33431 11.6676 3.2 11.8333 3.2H16.5C16.6657 3.2 16.8 3.33431 16.8 3.5V6.5C16.8 6.66569 16.6657 6.8 16.5 6.8H11.8333C11.6676 6.8 11.5333 6.66569 11.5333 6.5V3.5Z" stroke="#109CF1" stroke-width="1.4"/>
                              </svg>
                              Home</NavLink></li>
                          <li><NavLink to="/notification" activeStyle={{color:"#109CF1"}}>
                              <svg width="2em" height="1em" viewBox="0 0 21 21" fill="none" xmlns="http://www.w3.org/2000/svg">
                                  <path d="M2.50033 3.23H16.667C16.7309 3.23 16.8003 3.2882 16.8003 3.37333V8.43333C16.8003 8.51846 16.7309 8.57667 16.667 8.57667H2.50033C2.43644 8.57667 2.36699 8.51846 2.36699 8.43333V3.37333C2.36699 3.2882 2.43644 3.23 2.50033 3.23ZM2.50033 11.6633H16.667C16.7309 11.6633 16.8003 11.7215 16.8003 11.8067V16.8667C16.8003 16.9518 16.7309 17.01 16.667 17.01H2.50033C2.43644 17.01 2.36699 16.9518 2.36699 16.8667V11.8067C2.36699 11.7215 2.43644 11.6633 2.50033 11.6633Z" stroke="#C2CFE0" stroke-width="1.4"/>
                              </svg>
                              Notification</NavLink></li>
                          <li><NavLink to="/trade_i" activeStyle={{color:"#109CF1"}}>Trade Indicators</NavLink></li>
                          <li><NavLink to="/tariff_m" activeStyle={{color:"#109CF1"}}>Tariff Measures</NavLink></li>
                          <li><NavLink to="/nontariff_m" activeStyle={{color:"#109CF1"}}>Non-Tariff Measures</NavLink></li>
                          <li><NavLink to="/commodity" activeStyle={{color:"#109CF1"}}>Commodity-wise Analysis</NavLink></li>
                          <li><NavLink to="/case_s" activeStyle={{color:"#109CF1"}}>Case Studies</NavLink></li>
                          <li><NavLink to="/blog" activeStyle={{color:"#109CF1"}}>Blog</NavLink></li>
                          <li><NavLink to="/report" activeStyle={{color:"#109CF1"}}>Report</NavLink></li>
                  </ul>
              </div>
          </div>
          <div className="page">
            <Route exact strict path="/" component={Header}/>
            <Route exact strict path="/notification" component={Notification}/>
            <Route exact strict path="/trade_i" component={TradeI}/>
            <Route exact strict path="/tariff_m" component={TariffM}/>
            <Route exact strict path="/nontariff_m" component={NonTariffM}/>
            <Route exact strict path="/commodity" component={Commodity}/>
            <Route exact strict path="/case_s" component={CaseS}/>
            <Route exact strict path="/blog" component={Blog}/>
            <Route exact strict path="/report" component={Report}/>
          </div>
      </Router>
  );
}

export default App;
